import { useRouter } from 'next/router'
import data from '../../components/data.json';

export default () => {
  const router = useRouter()

  const post = data[router.query.id]
  if (!post) return <p></p>

  return (
    <>
       <h1>{post.title}</h1>
      <p>{post.content}</p>
    </>
  )
}
